import React, { useState, useEffect } from 'react';
import logo from '../images/zeptoLogo.svg';
import { useNavigate } from 'react-router-dom';

function Navbar() {
  const [showDropdown, setShowDropdown] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [otp, setOtp] = useState('');
  const [generatedOtp, setGeneratedOtp] = useState(null);
  const [showOtpInput, setShowOtpInput] = useState(false);
  const [otpError, setOtpError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    setIsLoggedIn(!!token);
  }, []);

  const handleIconClick = () => {
    setShowDropdown(!showDropdown);
  };

  const goToLogin = () => {
    navigate('/Login');
    setShowDropdown(false);
  };

  const goToRegister = () => {
    navigate('/Register');
    setShowDropdown(false);
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsLoggedIn(false);
    setShowDropdown(false);
    alert('Logged out successfully!');
    navigate('/');
  };

  function redirectToHome() {
    navigate('/Home');
  }

  // OTP functions
  const generateOtp = () => {
    const newOtp = Math.floor(100000 + Math.random() * 900000); // 6 digit random
    setGeneratedOtp(newOtp);
    console.log('Generated OTP:', newOtp); // In real, send via SMS/email
    setShowOtpInput(true); // Show input field
    setOtpError('');
  };

  const verifyOtp = () => {
    if (otp === String(generatedOtp)) {
      alert('OTP Verified Successfully!');
      setShowOtpInput(false);
      setOtp('');
      setGeneratedOtp(null);
    } else {
      setOtpError('Invalid OTP. Please try again.');
    }
  };

  return (
    <div className='shadow-lg'>
      <div className='container-fluid shadow-lg p-4'>
        <div className='row align-items-center'>
          <div className='col-lg-2'>
            <img src={logo} alt='logo' width="120" onClick={redirectToHome} style={{ cursor: 'pointer' }} />
          </div>
          <div className='col-lg-2'>
            <p>Location</p>
          </div>
          <div className='col-lg-5'>
            <input className='form-control' placeholder='Search' type='text' />
          </div>
          <div className='col-lg-1 position-relative'>
            <i 
              className="fa fa-user-circle-o fa-2x" 
              aria-hidden="true" 
              style={{ cursor: 'pointer' }}
              onClick={handleIconClick}
            ></i>

            {/* Dropdown */}
            {showDropdown && (
              <div className="position-absolute bg-white shadow rounded p-2" style={{ top: '50px', right: '0' }}>
                {isLoggedIn ? (
                  <p style={{ cursor: 'pointer' }} onClick={handleLogout}>Logout</p>
                ) : (
                  <>
                    <p style={{ cursor: 'pointer' }} onClick={goToLogin}>Login</p>
                    <p style={{ cursor: 'pointer' }} onClick={goToRegister}>Register</p>
                  </>
                )}
              </div>
            )}
          </div>

          {/* Cart Section */}
          <div className='col-lg-1'>
            Cart
          </div>

          {/* OTP Section */}
          <div className='col-lg-1'>
            <button className="btn btn-primary btn-sm" onClick={generateOtp}>
              Get OTP
            </button>
          </div>
        </div>

        {/* OTP Input Section */}
        {showOtpInput && (
          <div className="row mt-3 justify-content-center">
            <div className="col-lg-4">
              <input 
                type="text"
                className="form-control mb-2"
                placeholder="Enter OTP"
                value={otp}
                onChange={(e) => setOtp(e.target.value)}
              />
              <button className="btn btn-success" onClick={verifyOtp}>
                Verify OTP
              </button>
              {otpError && <p className="text-danger mt-2">{otpError}</p>}
            </div>
          </div>
        )}
      </div>
    </div>
  )
}

export default Navbar;
